import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css';
import HeroIllustration from './HeroIllustration';

const LandingPage = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [imageLoaded, setImageLoaded] = useState(false);
  const [imageError, setImageError] = useState(false);

  useEffect(() => {
    setIsVisible(true);

    // Simulate image loading delay
    const timer = setTimeout(() => {
      setImageLoaded(true);
    }, 300);

    return () => clearTimeout(timer);
  }, []);

  return (
    <div className="landing-page">
      {/* Remove the problematic inline style that might be affecting layout */}

      {/* Apply a more targeted fix for the horizontal scroll issue */}
      <style dangerouslySetInnerHTML={{ __html: `
        html, body {
          overflow-x: hidden;
          width: 100%;
          margin: 0;
          padding: 0;
        }

        /* Ensure the header isn't affected by our fixes */
        .site-header {
          width: 100%;
          max-width: 100%;
          box-sizing: border-box;
          padding: 0;
        }

        .header-container {
          width: 100%;
          max-width: 1400px;
          margin: 0 auto;
          padding: 1rem 10%;
          box-sizing: border-box;
        }

        /* Fix the problematic arrow element */
        [class*="scroll-arrow"] {
          position: fixed;
          right: 10px;
          max-width: 60px;
          z-index: 100;
          transform: translateX(0);
        }
      `}} />

      {/* Header/Navigation */}
      <header className="site-header">
        <div className="header-container">
          <div className="logo">
            <span className="logo-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <circle cx="12" cy="12" r="10" />
                <path d="M8 14s1.5 2 4 2 4-2 4-2" />
                <line x1="9" y1="9" x2="9.01" y2="9" />
                <line x1="15" y1="9" x2="15.01" y2="9" />
              </svg>
            </span>
            <span className="logo-text">Feedback Force</span>
          </div>
          <nav className="main-nav">
            <ul>
              <li><a href="#features">Features</a></li>
              <li><a href="#how-it-works">How It Works</a></li>
              <li><Link to="/app" className="nav-button">Launch App</Link></li>
            </ul>
          </nav>
        </div>
      </header>

      {/* Hero Section */}
      <section className="hero" style={{ 
        boxShadow: "none", 
        borderBottom: "none", 
        position: "relative",
        zIndex: 1,
        overflow: "visible",
        paddingBottom: 0,
        height: "auto",
        minHeight: "55vh",
        display: "flex",
        alignItems: "center",
        paddingTop: "80px"
      }}>
        <div className="banner-overlay"></div>

        {/* Left Content */}
        <div className="hero-content">
          <h1 className={`title ${isVisible ? 'fade-in' : ''}`}>
            <span className="title-highlight">Feedback</span> Force
          </h1>
          <p className={`subtitle ${isVisible ? 'fade-in delay-1' : ''}`}>
            Transform user feedback into actionable insights with AI-powered analysis and visualization
          </p>
          <div className={`cta-container ${isVisible ? 'fade-in delay-2' : ''}`}>
            <Link to="/app" className="cta-button">
              Get Started
            </Link>
            <a href="#how-it-works" className="secondary-link">
              Learn More
            </a>
          </div>
        </div>

        {/* Right Image */}
        <div className={`hero-image ${isVisible ? 'fade-in delay-1' : ''}`} style={{ 
          width: "100%", 
          maxWidth: "100%", 
          position: "absolute", 
          left: 0, 
          right: 0,
          boxShadow: "none",
          overflow: "hidden",
          boxSizing: "border-box"
        }}>
          <div className="image-container" style={{ 
            width: "100%",
            maxWidth: "100%",
            height: "375px",
            padding: 0,
            margin: 0,
            position: "relative",
            overflow: "hidden",
            boxShadow: "none",
            background: "transparent",
            border: "none",
            boxSizing: "border-box"
          }}>
            <svg 
              width="100%" 
              height="100%" 
              viewBox="800 40 400 200" 
              xmlns="http://www.w3.org/2000/svg"
              style={{ 
                background: "transparent",
                filter: "none"
              }}
              preserveAspectRatio="xMidYMid meet"
            >
              {/* Generate network with medium zoom level */}
              <g>
                {/* Central node */}
                <circle cx="1000" cy="140" r="22" fill="#3182CE" />

                {/* First ring of connections - reduced density */}
                {Array.from({ length: 20 }).map((_, i) => {
                  const angle = (i * 18) * Math.PI / 180;
                  const x = 1000 + Math.cos(angle) * 70;
                  const y = 140 + Math.sin(angle) * 55;
                  const color = ['#3182CE', '#38A169', '#DD6B20', '#E53E3E', '#805AD5', '#4299E1'][Math.floor(Math.random() * 6)];
                  return (
                    <React.Fragment key={`inner-${i}`}>
                      <line 
                        x1="1000" 
                        y1="140" 
                        x2={x} 
                        y2={y} 
                        stroke="#CBD5E0" 
                        strokeWidth="2" 
                        opacity="0.8" 
                      />
                      <circle 
                        cx={x} 
                        cy={y} 
                        r="7"
                        fill={color} 
                      />
                    </React.Fragment>
                  );
                })}

                {/* Second ring - adjusted to prevent overlaps */}
                {Array.from({ length: 40 }).map((_, i) => {
                  const angle = (i * 9) * Math.PI / 180;
                  const distance = 130 + Math.random() * 40;
                  const x = 1000 + Math.cos(angle) * distance;
                  const y = 140 + Math.sin(angle) * (distance * 0.7);
                  const connectToCenter = Math.random() > 0.5;
                  const color = ['#3182CE', '#38A169', '#DD6B20', '#E53E3E', '#805AD5', '#4299E1', '#D69E2E', '#319795', '#B83280'][Math.floor(Math.random() * 9)];
                  return (
                    <React.Fragment key={`middle-${i}`}>
                      {connectToCenter && (
                        <line 
                          x1="1000" 
                          y1="140" 
                          x2={x} 
                          y2={y} 
                          stroke="#CBD5E0" 
                          strokeWidth="1.5" 
                          opacity="0.6" 
                        />
                      )}
                      <circle 
                        cx={x} 
                        cy={y} 
                        r="5.5"
                        fill={color} 
                      />
                    </React.Fragment>
                  );
                })}

                {/* Outer ring - more spread */}
                {Array.from({ length: 80 }).map((_, i) => {
                  const angle = (i * 4.5) * Math.PI / 180;
                  const distance = 180 + Math.random() * 100;
                  const x = 1000 + Math.cos(angle) * distance;
                  const y = 140 + Math.sin(angle) * (distance * 0.6);
                  const connectToCenter = Math.random() > 0.7;
                  const color = ['#3182CE', '#38A169', '#DD6B20', '#E53E3E', '#805AD5', '#4299E1', '#D69E2E', '#319795', '#B83280'][Math.floor(Math.random() * 9)];
                  return (
                    <React.Fragment key={`outer-${i}`}>
                      {connectToCenter && (
                        <line 
                          x1="1000" 
                          y1="140" 
                          x2={x} 
                          y2={y} 
                          stroke="#CBD5E0" 
                          strokeWidth="1" 
                          opacity="0.4" 
                        />
                      )}
                      <circle 
                        cx={x} 
                        cy={y} 
                        r="4" 
                        fill={color} 
                      />
                    </React.Fragment>
                  );
                })}

                {/* Node-to-node connections */}
                {Array.from({ length: 70 }).map((_, i) => {
                  const angle1 = Math.random() * 360 * Math.PI / 180;
                  const angle2 = Math.random() * 360 * Math.PI / 180;
                  const distance1 = 60 + Math.random() * 180;
                  const distance2 = 60 + Math.random() * 180;
                  const x1 = 1000 + Math.cos(angle1) * distance1;
                  const y1 = 140 + Math.sin(angle1) * (distance1 * 0.7);
                  const x2 = 1000 + Math.cos(angle2) * distance2;
                  const y2 = 140 + Math.sin(angle2) * (distance2 * 0.7);

                  // Only connect if the nodes are somewhat close
                  const dx = x1 - x2;
                  const dy = y1 - y2;
                  const distance = Math.sqrt(dx*dx + dy*dy);

                  if (distance < 120) {
                    return (
                      <line 
                        key={`connection-${i}`}
                        x1={x1} 
                        y1={y1} 
                        x2={x2} 
                        y2={y2} 
                        stroke="#CBD5E0" 
                        strokeWidth="1" 
                        opacity="0.3" 
                      />
                    );
                  }
                  return null;
                })}
              </g>
            </svg>
          </div>
        </div>
      </section>

      {/* Features Section - clean transition */}
      <section className="features" id="features" style={{
        position: "relative",
        zIndex: 5,
        boxShadow: "none",
        borderTop: "none",
        background: "white",
        marginTop: 0,
        paddingTop: "3rem"
      }}>
        <h2>Key Features</h2>
        <div className="features-grid">
          <div className="feature-card">
            <div className="feature-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <path d="M12 2L2 7l10 5 10-5-10-5zM2 17l10 5 10-5M2 12l10 5 10-5" />
              </svg>
            </div>
            <h3>AI Theme Detection</h3>
            <p>Automatically identify patterns and themes in user feedback</p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <circle cx="12" cy="12" r="10" />
                <path d="M8 14s1.5 2 4 2 4-2 4-2" />
                <line x1="9" y1="9" x2="9.01" y2="9" />
                <line x1="15" y1="9" x2="15.01" y2="9" />
              </svg>
            </div>
            <h3>Visual Network Analysis</h3>
            <p>Interactive visualization of feedback relationships</p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <path d="M17 21v-2a4 4 0 0 0-4-4H5a4 4 0 0 0-4 4v2" />
                <circle cx="9" cy="7" r="4" />
                <path d="M23 21v-2a4 4 0 0 0-3-3.87" />
                <path d="M16 3.13a4 4 0 0 1 0 7.75" />
              </svg>
            </div>
            <h3>Persona Insights</h3>
            <p>Understand feedback patterns across different user roles</p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                <path d="M14 9V5a3 3 0 0 0-3-3l-4 9v11h11.28a2 2 0 0 0 2-1.7l1.38-9a2 2 0 0 0-2-2.3zM7 22H4a2 2 0 0 1-2-2v-7a2 2 0 0 1 2-2h3" />
              </svg>
            </div>
            <h3>Smart Sentiment Analysis</h3>
            <p>AI-powered analysis of user sentiment and priorities</p>
          </div>
        </div>
      </section>

      {/* How It Works Section - more compact */}
      <section className="how-it-works" id="how-it-works">
        <h2>How It Works</h2>
        <div className="steps">
          <div className="step">
            <div className="step-number">1</div>
            <h3>Import your feedback data</h3>
            <p>Upload your customer feedback from various sources</p>
          </div>

          <div className="step-connector"></div>

          <div className="step">
            <div className="step-number">2</div>
            <h3>AI analyzes patterns</h3>
            <p>Our AI identifies themes, sentiment, and relationships</p>
          </div>

          <div className="step-connector"></div>

          <div className="step">
            <div className="step-number">3</div>
            <h3>Explore insights</h3>
            <p>Interact with the visualization to discover actionable insights</p>
          </div>
        </div>

        <Link to="/app" className="secondary-cta-button">
          Start Analyzing Your Feedback
        </Link>
      </section>

      {/* Footer - more compact */}
      <footer>
        <div className="footer-content">
          <div className="footer-logo">
            <h2>Feedback Force</h2>
            <p>Transform feedback into insights</p>
          </div>
          <div className="footer-links">
            <div className="footer-column">
              <h3>Product</h3>
              <ul>
                <li><a href="#features">Features</a></li>
                <li><a href="#how-it-works">How It Works</a></li>
                <li><Link to="/app">Dashboard</Link></li>
              </ul>
            </div>
            <div className="footer-column">
              <h3>Resources</h3>
              <ul>
